import AppDispatcher from '../dispatcher/AppDispatcher';

var TripDetailActions = {



    dispatch: function(actionType, actionPayload) {
        AppDispatcher.dispatch({
            action: {
                type: actionType,
                payload: actionPayload
            }
        });
    }
};

export default TripDetailActions;
